[center]Okay, I was walking around RS using T X's mapdata dumper, and RSbot. Decided to go find these since I haven't really seen anything else with these.

[b]I don't know if I'm allowed to post this here, but there is no other section known for 503s, so I guess i'll just post it here. if I'm not, just lock it, or just move it somewhere, and I know it's copy and paste + download, but theres not much more of any way to explain this out. Yes I did post this on rune server, i'm just trying to progress some part of the 503s with releasing some of the mapdata I have gained.[/b]

Download [url=http://uppit.com/LTQ7W9]this[/url] file, and extract the .txt files to your mapdata folder in your server's data folder.

If it asks "This file already exists, would you like to replace it?" Click yes to all.

In button.java, add these inside of case 192;

[code]		if(button == 37) { // Duel arena tournament
		p.teleportToX = 3231;
		p.teleportToY = 5091;
		}
		if(button == 44) { // Varrock Museum (downstairs)
		p.teleportToX = 1759;
		p.teleportToY = 4958;
		}
		if(button == 47) { // Fist of guthix main room
		p.teleportToX = 1675;
		p.teleportToY = 5599;
		}[/code]

If you don't have a case 192, then add this;

[code]case 192:
		if(button == 37) { // Duel arena tournament
		p.teleportToX = 3231;
		p.teleportToY = 5091;
		}
		if(button == 44) { // Varrock Museum (downstairs)
		p.teleportToX = 1759;
		p.teleportToY = 4958;
		}
		if(button == 47) { // Fist of guthix main room
		p.teleportToX = 1675;
		p.teleportToY = 5599;
		}
break;[/code]

The teleports are Watchtower, Trollheim, and Ape atoll, feal free to change them, If you don't know how to make a simple button do something, then you shouldn't be using the 503.

